import { gql } from 'apollo-boost';

// Creating a new user through sign up
const newUserMutation = gql`
  mutation newUser($firstName: String, $lastName: String, $email: String, $password: String, $user_type: String,
    $phone :Number, $restaurant_name:String,$zipcode:Number) {
      newUser(firstName: $firstName, lastName: $lastName, email: $email, password: $password,
       user_type: $user_type,phone:$phone,restaurant_name:$restaurant_name,zipcode:$zipcode) {
      firstName
      lastName
      email
      user_type
      phone
      restaurant_name
      zipcode
       }
      }
`;

// Enrolling into a course
const enrollCourse = gql`
  mutation enrollCourse($email: String, $id: String) {
    enrollCourse(email: $email, id: $id) {
      email
      id
    }
  }
`;

// Creating a new course - by faculty
const createCourse = gql`
  mutation createCourse(
    $id: String
    $courseName: String
    $facultyEmail: String
    $description: String
    $department: String
    $room: String
    $capacity: Number
    $waitlist: Number
    $term: String
  ) {
    createCourse(
      id: $id
      courseName: $courseName
      facultyEmail: $facultyEmail
      description: $description
      department: $department
      room: $room
      capacity: $capacity
      waitlist: $waitlist
      term: $term
    ) {
      facultyEmail
      id
    }
  }
`;

// Updating user profile details
const updateUser = gql`
  mutation updateUser(
    $email: String
    $aboutMe: String
    $city: String
    $country: String
    $school: String
    $hometown: String
    $languages: String
    $gender: String
    $company: String
  ) {
    updateUser(
      email: $email
      aboutMe: $aboutMe
      city: $city
      country: $country
      school: $school
      hometown: $hometown
      languages: $languages
      gender: $gender
      company: $company
    ) {
      email
      aboutMe
    }
  }
`;

export { newUserMutation, enrollCourse, createCourse, updateUser };
